Thanks to all of the beautiful humans who walked this show, and to the beautiful humans who made it happen.

How fitting that my first issue as Fashion Director of Autre Magazine would be themed, Utopia. If you know me, if you’ve worked with me, you know that my inquiry into fashion is rooted in the ways in which we all use clothing to share our personal stories. Fashion, even at its most divisive or controversial, by nature, then, holds a common thread.

What is a perfect fashion well? I don’t know. But Autre’s is one that sees; a virtual seat at a cafe corner in cities far and wide, observing people as they pass, in the context of brilliantly inquisitive musings about art, culture and the ever-evolving world in which we live. I hope you will join me, us, on the journey. 

Hugest thanks to Oliver and Summer for your trust. Also to my team, and to the brilliant roster of friends and colleagues who have come to the table with your support and creative talents. I’ll name as many as I can here, and I invite you to pre-order the print issue at www.Autre.love to receive a digital advance copy to see everyone - and everything - else. ❤️

